sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var mainArr=inputs.req.product.coverDetails;
var riderArr=inputs.req.product.coverDetails.riderDetails;
//gs.info(mainArr)
var res=[]
var obj={};
// obj={
//     "stringval1":mainArr.mainCover.mainCover,
//     "stringval2":mainArr.mainCover.mainCoverSumAssured,
//     "stringval3":mainArr.mainCover.mainCoverPT,
//     "stringval4":mainArr.mainCover.mainCoverPPT,
// }

obj={
    "stringval1":mainArr.mainCoverValue,
    "stringval2":inputs.req.insuredPerson.sumAssured,
    "stringval3":inputs.req.product.policyTerm,
    "stringval4":inputs.req.product.policyPaymentTerm,
}
res.push(obj);
//gs.info("quote:" + JSON.stringify(riderArr))
if(riderArr.length>0){
    riderArr.forEach(function(element){
        obj={};
        obj={
    "stringval1":element.riderCoverCode,
    "stringval2":element.riderSumAssured,
    "stringval3":element.riderPolicyterm,
    "stringval4":element.riderPremiumPolicyTerm,
        }

        res.push(obj);
    })
}
//gs.info(res);
var resultObject = JSON.parse(inputs.jObj);

var a = {
    "WeoRecStrings150User": res
}
resultObject.pInList1_inout = a;
//gs.info(JSON.stringify(a))

//gs.info(JSON.stringify(resultObject))
outputs.res=resultObject;
})(inputs, outputs);

